        balanceLabel={"Balance"} 
        balanceAmount={"11,500.99 DAI"} 
        aprLabel={"Apr"} 
        aprAmount={"6.7%"}
        earnedLabel={"Earned"} 
        earnedAmount={"143.54 DAI"} 
        />

      );
}

export default Bzx;
